‚Äã@@fullmetal313 Genesis 1:26-31 ESV ‚Äî Then God said, ‚ÄúLet us make man in our image, after our likeness. And let them have dominion over the fish of the sea and over the birds of the heavens and over the livestock and over all the earth and over every creeping thing that creeps on the earth.‚Äù So God created man in his own image,
in the image of God he created him;
male and female he created them. And God blessed them. And God said to them, ‚ÄúBe fruitful and multiply and fill the earth and subdue it, and have dominion over the fish of the sea and over the birds of the heavens and over every living thing that moves on the earth.‚Äù And God said, ‚ÄúBehold, I have given you every plant yielding seed that is on the face of all the earth, and every tree with seed in its fruit. You shall have them for food. And to every beast of the earth and to every bird of the heavens and to everything that creeps on the earth, everything that has the breath of life, I have given every green plant for food.‚Äù And it was so. And God saw everything that he had made, and behold, it was very good. And there was evening and there was morning, the sixth day.

